
    (function(){
      var adoptScript64 = '';
      var adoptScript = document.createElement("script");
      adoptScript.className = "adopt-injector-code";
      adoptScript.textContent = decodeURIComponent(atob(adoptScript64).split('').map(function(c) {
        return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
      }).join(''));
      adoptScript.charset = "UTF-8";
      document.head.appendChild(adoptScript);
    }());
    